import React, { useState } from 'react'
import axios from "axios"

const Createpdf = () => {

    const [Name, setName] = useState()
    return (
        <>
            <div className="container d-flex flex-column justify-content-center align-items-center">
                <div className="div">
                            <p><label for="username">Username</label></p>
                            <p><input type="text" name="name" id="username"
                                onChange={(e) => {
                                    setName(e.target.value);
                                }}/></p>
                </div>
                <div className="div">
                            <p><label for="receiptid">rid</label></p>
                            <p><input type="text" name="receiptid" id="username"
                                onChange={(e) => {
                                    setName(e.target.value);
                                }}/></p>
                </div>
                <div className="div">
                            <p><label for="price1">p1</label></p>
                            <p><input type="number" name="price1" id="username"
                                onChange={(e) => {
                                    setName(e.target.value);
                                }}/></p>
                </div>
                <div className="div">
                            <p><label for="price2">p2</label></p>
                            <p><input type="number" name="price1" id="username"
                                onChange={(e) => {
                                    setName(e.target.value);
                                }}/></p>
                </div>
                           <button className="btn btn-primary px-4 py-2">Create</button>
            </div>
        </>
    )
}

export default Createpdf
